Performers of the Year 2012 (Elegant Angel) (720p Split Scenes)

Starring : Asa Akira, Bobbi Starr, Gracie Glam, James Dean, Jayden Jaymes, Jordan Ash, Kagney Linn Karter, Kristina Rose, Lexi Belle, Manuel Ferrara, Michael Stefano 

Adult Entertainment Studio, Elegant Angel Productions, is Proud to announce the latest Volume of ITS Annual series, &quot;Performers Of The Year 2012 &quot;scheduled for release on January 11th. The movie will be a 2-Disc Set, featuring 7 scenes, and starring the biggest names of the year: Asa Akira, Kagney Linn Karter, Kristina Rose, Gracie Glam, Lexi Belle, Jayden Jaymes, and Bobbi Starr.

